description:
20 Years of Jethro Tull is a (1988) boxed set which spans the first twenty years of Jethro Tull. It was issued onto five LPs: Radio Archives, Rare Tracks, Flawed Gems, Other Sides of Tull, and The Essential Tull. It was repackaged onto three CDs, which was titled 20 Years of Jethro Tull: The Definitive Edition. A single CD sampler and a double LP album were also created, titled 20 Years of Jethro Tull: Highlights.

